/* Base */
@import url("https://fonts.googleapis.com/css2?family=League+Spartan&display=swap");
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: "League Spartan", sans-serif;
}
h1 {
  font-size: 50px;
  line-height: 64px;
  color: #222;
}
h2 {
  font-size: 46px;
  line-height: 54px;
  color: #222;
}
h4 {
  font-size: 20px;
  color: #222;
}
h6 {
  font-size: 12px;
  font-weight: 700;
}
p {
  font-size: 16px;
  color: #465b52;
  margin: 15px 0 20px 0;
}
.section-p1 {
  padding: 40px 80px;
}
.section-m1 {
  margin: 40px 0;
}
button.normal {
  font-size: 14px;
  font-weight: 600;
  padding: 15px 30px;
  color: #000;
  background-color: #e3e6f3;
  border-radius: 4px;
  cursor: pointer;
  border: none;
  outline: none;
  transition: 0.2s;
}
a {
  text-decoration: none;
  font-size: 16px;
  font-weight: 600;
  color: #1a1a1a;
}
body {
  width: 100%;
}
footer {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
}
footer .col {
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  margin-bottom: 20px;
}
footer h3 {
  font-style: 14px;
  padding-bottom: 20px;
}
footer p {
  font-style: 13px;
  margin: 0 0 8px 0;
}
footer a {
  font-style: 13px;
  text-decoration: none;
  color: #222;
  margin-bottom: 10px;
}
footer .follow {
  margin-top: 20px;
}
footer .follow i {
  color: #465b52;
  padding-right: 4px;
  cursor: pointer;
}
footer .install .row svg {
  border: 1px solid #088178;
  border-radius: 6px;
  width: 80px;
  height: 30px;
  cursor: pointer;
}
footer .install svg {
  margin: 10px 0 15px 0;
}
footer .follow i:hover,
footer a:hover {
  color: #088178;
}
footer .copyright {
  width: 100%;
  text-align: center;
}

/* Header */
#header {
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 20px 80px;
  background: #e3e6f3;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.06);
  z-index: 999;
  position: sticky;
  top: 0;
  left: 0;
}
#header_text {
  text-decoration: none;
  font-size: 16px;
  font-weight: 900;
  color: #1a1a1a;
}
#navbar {
  display: flex;
  align-items: center;
  justify-content: center;
}
#navbar li {
  list-style: none;
  padding: 0 20px;
  position: relative;
}
#navbar li a {
  text-decoration: none;
  font-size: 16px;
  font-weight: 600;
  color: #1a1a1a;
  transition: 0.3s ease;
}
#navbar li a:hover,
#navbar li a.active {
  color: #ffb3b3;
}
#navbar li a.active::after,
#navbar li a:hover::after {
  content: "";
  width: 30%;
  height: 2px;
  background: #ffb3b3;
  position: absolute;
  bottom: -4px;
  left: 20px;
}
#mobile {
  display: none;
  align-items: center;
}
#close {
  display: none;
}

/* Landing */
#landing {
  position: relative;
  height: 90vh;
  width: 100%;
  padding: 0 80px;
  display: flex;
  overflow: hidden;
  flex-direction: column;
  align-items: flex-start;
  justify-content: center;

  &::after {
    content: "";
    position: absolute;
    top: 0;
    left: 55%;
    width: 60%;
    height: 100%;
    background-image: url("../images/loader_pic.png");
    background-size: cover;
  }
}
#landing h4 {
  padding-bottom: 15px;
}
#landing h1 {
  color: #ffb3b3;
}
#landing button {
  position: absolute;
  top: 65%;
  left: 10%;
  border: none;
  cursor: pointer;
  background: #ffb3b3;
  color: #000;
  text-align: center;
  text-decoration: none;
  font-size: 16px;
  font-weight: 700;
  transition: transform 0.5s;
}

/* Features */
#feature .fe-box {
  width: 180px;
  text-align: center;
  padding: 25px 10px;
  box-shadow: 20px 20px 34px rgba(0, 0, 0, 0.03);
  border: 1.5px solid #cce7d0;
  border-radius: 4px;
  margin: 15px 0;
}
#feature {
  display: flex;
  align-items: center;
  justify-content: space-between;
  flex-wrap: wrap;
}
#feature .fe-box:hover {
  box-shadow: 10px 10px 54px rgba(70, 62, 221, 0.1);
}
#feature .fe-box img {
  width: 60%;
  margin-bottom: 10px;
}
#feature .fe-box:nth-child(3) img {
  width: 75%;
  margin-bottom: 10px;
}
#feature .fe-box h6 {
  display: inline-block;
  padding: 9px 8px 6px 8px;
  line-height: 1;
  border-radius: 4px;
  color: #000;
  background-color: #e3e6f3;
}

/* Product */
#product {
  text-align: center;
}
#product .pro-container {
  display: flex;
  justify-content: space-between;
  padding-top: 20px;
  flex-wrap: wrap;
}
#product .pro {
  width: 23%;
  min-width: 250px;
  padding: 10px 12px;
  border-radius: 25px;
  border: 1.5px solid #000;
  cursor: pointer;
  box-shadow: 20px 20px 30px rgba(0, 0, 0, 0.02);
  margin: 15px 0;
  transition: 0.2s ease;
  position: relative;
}
#product .pro:hover {
  box-shadow: 20px 20px 30px rgba(0, 0, 0, 0.06);
}
#product .pro img {
  width: 100%;
  height: 65%;
  border-radius: 20px;
  border: 1.5px solid #000;
}
#product .pro .des {
  text-align: start;
  padding: 10px 0;
}
#product .pro .des span {
  color: #060603;
  font-size: 12px;
}
#product .pro .des h5 {
  padding-top: 5px;
  color: #1a1a1a;
  font-size: 14px;
}
#product .pro .des i {
  font-size: 12px;
  color: rgb(243, 181, 25);
}
#product .pro .des i.colorless {
  font-size: 12px;
  color: #d9d9d9;
}
#product .pro .des h4 {
  padding-top: 7px;
  font-size: 17px;
  font-weight: 700;
  color: #088178;
}
#product .pro a .cart {
  display: block;
  width: 40px;
  height: 40px;
  line-height: 40px;
  border-radius: 50px;
  background-color: #e3e6f3;
  font-weight: 700;
  color: #000;
  position: absolute;
  bottom: 20px;
  right: 10px;
}

/* Action Banner */
#banner {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-image: url("../images/repair.jpeg");
  width: 100%;
  height: 40vh;
  background-size: cover;
  background-position: center;
}
#banner h4 {
  color: #fff;
  font-size: 20px;
  font-weight: bold;
}
#banner h2 {
  color: #fff;
  font-size: 30px;
  padding: 10px 0;
  font-weight: bold;
}
#banner h2 span {
  color: #ef3636;
}
#banner button:hover {
  background: #ffb3b3;
  color: #fff;
}

/* Newsletter */
#newsletter {
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  align-items: center;
  background-repeat: no-repeat;
  background-position: 20% 30%;
  background-color: #000;
}
#newsletter h4 {
  font-size: 22px;
  font-weight: bold;
  color: #fff;
}
#newsletter p {
  font-size: 14px;
  font-weight: bold;
  color: #fff;
}
#newsletter p span {
  color: #ffbd27;
}
#newsletter .form {
  display: flex;
  width: 40%;
}
#newsletter input {
  height: 3.125rem;
  padding: 0 1.2em;
  font-style: 14px;
  width: 100%;
  border: 1px solid transparent;
  border-radius: 4px;
  outline: none;
  border-top-right-radius: 0;
  border-bottom-right-radius: 0;
}

#newsletter button {
  background-color: #088178;
  color: #fff;
  white-space: nowrap;
  border-top-left-radius: 0;
  border-bottom-left-radius: 0;
}

/* Shop */
#shopbanner {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-image: url("../images/Shopping_Banner.png");
  width: 100%;
  height: 40vh;
  background-size: cover;
  background-position: center;
  padding: 14px;
}
#shopbanner h2,
#shopbanner p {
  color: #fff;
}

/*page navigator*/
#pagination {
  text-align: center;
}
#pagination a {
  text-decoration: none;
  background-color: #088178;
  padding: 15px 20px;
  border-radius: 4px;
  color: #fff;
  font-weight: 600;
}
#pagination a i {
  font-size: 16px;
  font-weight: 600;
}

/*single product*/
#prodetails {
  display: flex;
  margin-top: 20px;
}
#prodetails .single-pro-image {
  width: 40%;
  margin: 50px;
}
.mainimg,
.small-img {
  border: 1.5px solid #000;
}
.small-img-group {
  display: flex;
  justify-content: space-between;
}
.small-img-col {
  flex-basis: 24%;
  cursor: pointer;
}
#prodetails .single-pro-details {
  width: 50%;
  padding-top: 30px;
}
#prodetails .single-pro-details h4 {
  padding: 40px 0 20px 0;
}
#prodetails .single-pro-details h2 {
  padding: 40px 0 20px 0;
  font-size: 26px;
  color: #088178;
}
#prodetails .single-pro-details select {
  display: block;
  padding: 5px 10px;
  margin-bottom: 10px;
}
#prodetails .single-pro-details input {
  width: 50px;
  height: 47px;
  padding-left: 10px;
  font-size: 15px;
  margin-right: 10px;
}
#prodetails .single-pro-details input:focus {
  outline: none;
}
#prodetails .single-pro-details button {
  background: #088178;
  color: #fff;
}
#prodetails .single-pro-details span {
  line-height: 25px;
}

/*service banner*/
#servicebanner {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-image: url("../images/service_banner.jpg");
  width: 100%;
  height: 40vh;
  background-size: cover;
  background-position: center;
  padding: 14px;
}
#servicebanner h2,
#servicebanner p {
  color: #000;
}

/*services info*/
#info {
  padding: 150px 150px 0 150px;
}
#info .info-box {
  display: flex;
  align-items: center;
  width: 100%;
  position: relative;
  padding-bottom: 90px;
}
#info .info-img {
  width: 50%;
  margin-right: 40px;
}
#info img {
  width: 300px;
  height: 300px;
  object-fit: cover;
}
#info .info-details a {
  color: #088178;
  position: relative;
  transition: 0.3s;
}
#info .info-box h1 {
  position: absolute;
  top: -40px;
  left: 0;
  font-size: 70px;
  font-weight: 700;
  color: #088178;
  z-index: -9;
}

/*about banner*/
#aboutbanner {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-image: url("../images/about.jpg");
  width: 100%;
  height: 40vh;
  background-size: cover;
  background-position: center;
  padding: 14px;
}
#aboutbanner h2,
#aboutbanner p {
  color: #000;
}

/*who we are*/
#about-head {
  display: flex;
  align-items: center;
}
#about-head img {
  width: 50%;
  height: auto;
}
#about-head div {
  padding-left: 40px;
}
#about-head p {
  font-size: 18px;
  color: #000;
  font-weight: 600;
}

/*contact banner*/
#contactbanner {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-image: url("../images/contact_us.avif");
  width: 100%;
  height: 40vh;
  background-size: cover;
  background-position: center;
  padding: 14px;
}

#contactbanner h2,
#contactbanner p {
  color: #fff;
}

/*get in touch*/
#contact-details {
  display: flex;
  align-self: center;
  justify-content: space-between;
}
#contact-details .details {
  width: 40%;
}
#contact-details .details span,
#form-details form span {
  font-size: 12px;
}
#contact-details .details h2,
#form-details form h2 {
  font-size: 26px;
  line-height: 35px;
  padding: 20px 0;
}
#contact-details .details h3 {
  font-size: 16px;
  padding-bottom: 15px;
}
#contact-details .details li {
  list-style: none;
  display: flex;
  padding: 10px 0;
}
#contact-details .details li i {
  font-size: 14px;
  padding-right: 22px;
}
#contact-details .details p {
  margin: 0;
  font-size: 14px;
}
#contact-details .map {
  width: 55%;
  height: 400px;
}
#contact-details .map iframe {
  width: 100%;
  height: 100%;
}
#form-details {
  margin: 30px;
  padding: 80px;
}
#form-details form {
  width: 65%;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
}
#form-details form input,
#form-details form textarea {
  width: 100%;
  padding: 12px 15px;
  outline: none;
  margin-bottom: 20px;
  border: 1px solid #000;
}
#form-details form button {
  color: #fff;
  background-color: #088178;
}

/*cart banner*/
#cartbanner {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
  background-image: url("../images/cart_banner.jpeg");
  width: 100%;
  height: 40vh;
  background-size: cover;
  background-position: center;
  padding: 14px;
}

#cartbanner h2,
#cartbanner p {
  color: #000;
}

/*cart*/
#cart {
  overflow-x: auto;
}
#cart table {
  width: 100%;
  border-collapse: collapse;
  table-layout: fixed;
  white-space: nowrap;
}
#cart table img {
  width: 70px;
  border: 1.5px solid #000;
}
#cart table td {
  font-weight: bold;
}
#cart table td:nth-child(1) {
  width: 1o0px;
  text-align: center;
}
#cart table td:nth-child(2) {
  width: 150px;
  text-align: center;
}
#cart table td:nth-child(3) {
  width: 250px;
  text-align: center;
}
#cart table td:nth-child(4),
#cart table td:nth-child(5),
#cart table td:nth-child(6) {
  width: 150px;
  text-align: center;
}
#cart table td:nth-child(4),
#cart table td:nth-child(6) {
  color: #088178;
}
#cart table thead td:nth-child(4),
#cart table thead td:nth-child(6) {
  color: #000;
}
#cart table td:nth-child(5) input {
  width: 70px;
  padding: 10px 5px 10px 15px;
}
#cart table thead {
  border: 1px solid #000;
  border-left: none;
  border-right: none;
}
#cart table thead td {
  font-weight: bolder;
  font-size: 13px;
  padding: 18px 0;
}
#cart table tbody tr td {
  padding-top: 15px;
}
#cart table tbody td {
  font-size: 13px;
}
#cart-add {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
}
#coupon {
  width: 50%;
  margin-bottom: 30px;
}
#coupon h3,
#subtotal h3 {
  padding-bottom: 13px;
}
#coupon input {
  padding: 10px 20px;
  outline: none;
  width: 60%;
  margin-right: 10px;
  border: 1px solid #000;
}
#coupon button,
#subtotal button {
  background-color: #088178;
  color: #fff;
  padding: 12px 20px;
}
#subtotal {
  width: 50%;
  margin-bottom: 30px;
  border: 1px solid #000;
  padding: 30px;
}
#subtotal table {
  border-collapse: collapse;
  width: 100%;
  margin-bottom: 20px;
}
#subtotal table td {
  width: 50%;
  border: 1px solid #000;
  padding: 10px;
  font-size: 13px;
}

@media (max-width: 799px) {
  .section-p1 {
    padding: 40px 40px;
  }

  #navbar {
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: flex-start;
    position: fixed;
    top: 0;
    right: -300px;
    height: 100vh;
    width: 300px;
    background-color: #e3e6f3;
    box-shadow: 0 40px 60px rgba(0, 0, 0, 0.1);
    padding: 80px 0 0 10px;
    transition: 0.3s;
  }

  #navbar.active {
    right: 0;
  }

  #navbar li {
    margin-bottom: 25px;
  }
  #mobile {
    display: flex;
    align-items: center;
  }

  #mobile i {
    color: #1a1a1a;
    font-size: 24px;
    padding-left: 20px;
  }

  #close {
    display: initial;
    position: absolute;
    top: 30px;
    left: 30px;
    color: #222;
    font-size: 24px;
  }

  #lg-cart {
    display: none;
  }
  #landing {
    height: 70vh;
    padding: 0 80px;
    background-position: top 30% right 30%;
  }

  #landing::after {
    content: "";
    position: absolute;
    top: 30%;
    left: 70%;
    width: 35%;
    height: 35%;
    background-image: url("../images/loader_pic.png");
    background-size: cover;
  }

  #landing h4,
  #landing h1,
  #landing h2,
  #landing p {
    margin-left: -7%;
  }

  #landing button {
    position: absolute;
    top: 72%;
    left: 10%;
  }
  #feature {
    justify-content: center;
  }
  #feature .fe-box {
    margin: 15px 15px;
  }
  #product .pro-container {
    justify-content: space-between;
  }
  #product .pro {
    margin: 15px;
  }
  #banner,
  #shopbanner,
  #servicebanner,
  #cartbanner,
  #contactbanner,
  #aboutbanner {
    height: 20vh;
  }
  #newsletter .form {
    width: 70%;
  }
  #info .info-details {
    width: 50%;
    margin-left: 10%;
  }
  #form-details {
    padding: 40px;
  }
  #form-details form {
    width: 100%;
  }
}

@media (max-width: 477px) {
  .section-p1 {
    padding: 20px;
  }
  #header {
    padding: 10px 30px;
  }
  #landing {
    padding: 0 20px;
  }
  #landing::after {
    content: "";
    position: absolute;
    top: 30%;
    left: 100%;
    width: 35%;
    height: 35%;
    background-image: url("../images/loader_pic.png");
    background-size: cover;
  }
  #landing h4,
  #landing h1,
  #landing h2,
  #landing p {
    margin-left: -2.5%;
  }
  #landing p {
    margin-top: 2%;
  }
  #landing button {
    position: absolute;
    top: 90%;
    left: 30%;
  }
  h2 {
    font-size: 32px;
  }
  h1 {
    font-size: 38px;
  }
  #feature {
    flex-direction: column;
  }
  #feature .fe-box {
    width: 70%;
    margin: 0 0 15px 0;
  }
  #product .pro {
    width: 100%;
  }
  #banner,
  #shopbanner,
  #servicebanner,
  #cartbanner,
  #contactbanner,
  #aboutbanner {
    height: 40vh;
  }
  #newsletter {
    padding: 40px 20px;
  }
  #newsletter .form {
    width: 100%;
  }
  #prodetails {
    display: flex;
    flex-direction: column;
  }
  #prodetails .single-pro-image {
    width: 80%;
    margin-right: 0px;
  }
  #prodetails .single-pro-details {
    width: 100%;
  }
  #info {
    padding: 100px 20px 0 20px;
  }
  #info .info-box {
    display: flex;
    flex-direction: column;
    align-items: flex-start;
  }
  #info .info-img {
    width: 100%;
    margin-right: 0;
    margin-bottom: 30px;
  }
  #info .info-details {
    width: 85%;
  }
  #about-head {
    flex-direction: column;
  }
  #about-head img {
    width: 100%;
    margin-bottom: 20px;
  }
  #about-head div {
    padding-left: 0px;
  }
  #contact-details {
    flex-direction: column;
  }
  #contact-details .details {
    width: 100%;
    margin-bottom: 30px;
  }
  #contact-details .map {
    width: 100%;
  }
  #form-details {
    margin: 10px;
    padding: 30px 10px;
  }
  #form-details form {
    width: 100%;
    margin-bottom: 30px;
  }
  #cart-add {
    flex-direction: column;
  }
  #coupon {
    width: 100%;
  }
  #subtotal {
    width: 100%;
    padding: 20px;
  }
  footer .copyright {
    padding: 40px 20px;
    text-align: start;
  }
  footer img {
    width: 70%;
  }
}
